description:
Um passeio para toda a família em percursos histórico | Urbanos

Objectivos:
    • Potenciar hábitos de Vida Saudáveis;
    • Unir as famílias na prática desportiva, essencialmente a utilização de bicicleta;
    • Sensibilização ecológica;

O Passeio teve a sua primeira edição em 2011, na Figueira da Foz repetindo-se anualmente na mesma cidade até 2016, alargou-se para Mirandela e Eco Pista do Dão. Em 2017 o projeto transfere-se para Lisboa com a associação do Sport Lisboa e Benfica de forma a fazer chegar junto dos seus associados e simpatizantes uma oportunidade única de praticar atividade desportiva em família na cidade de Lisboa.

Também a Câmara Municipal de Lisboa se assume como parceira com o evento inserindo-se no mote da candidatura a Capital Europeia do Desporto.

A realizar no próximo dia 4 de Junho de 2017, em Lisboa, com Partida e chegada do Estádio do Sport Lisboa e Benfica.

Um passeio em família de 19 km pela cidade de Lisboa, para todos usufruírem dos principais ex-líbris da cidade, seja o Parque Eduardo VII ou a magnífica Praça do Marquês, a descida pela Av. Liberdade até à grandeza ribeirinha do Terreiro do Paço, da tradicional Praça da Figueira aos Restauradores estamos de volta ao Marquês, a passagem pelo Saldanha e Campo Grande, e estamos na Cidade Universitária e de novo o estádio do Sport Lisboa e Benfica.

Inscrições em http://ecobikebenfica.bol.pt

1°  ♠️Torneio de Poker Universitário de Bauru e Região ♠️:

Fala rapazeada, quem ai não está afim de jogar um pokerzão com os brothers?

Vamos reunir todo mundo que está afim de jogar no dia 11/06 e realizar um torneio Universitário no domingão!

Em breve soltaremos mais informações, mas podemos adiantar pra vocês que será um Torneio diferenciado, discontraído e claro repleto de boas jogadas 🤘🏽 🃏🃏🃏

Queremos que todos divirtam-se e de quebra iremos dar uma breja 🍻 ou uma caipirinha 🍸pra cada jogador que se inscrever e durante todo o torneio teremos alguns petiscos a vontade . Além disso, contaremos com um bar de apoio durante todo o torneio: 

- Espetinho R$ 4,50
- Cerveja BRAHMA R$ 5,00 ou 3 por R$12,00

8k de Fichas para cada jogador!

🏆🏅 Premiação para 1°, 2° e 3°Lugar que em breve será divulgada aqui no evento.

Contaremos com Dealers treinados e capacitados para qualquer imprevisto. Sem delongas, é isso!

LET'S PLAY!

REGRAS:
* 🔞Será proibida a entrada de menores de 18 anos;
*🚫Será proibida a prática de CASH GAME;
* 🚭Proibido o uso de drogas ilícitas;
* 🚫Proibido trazer bebidas;
* 🚫Será permitido somente  2 rebuys por jogadores;
* 🚫Inscrição mediante a carteirinha de estudante;

De resto é só curtir e mostrar como se joga 🤘🏽🃏
